  `right_edge_location` int(11) NOT NULL default '0',
  `hp` int(11) NOT NULL default '0',
  `keeper` int(11) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

